subSubSection.paragraph:
Male (n= 1 ): Body length 10.8 mm width 730 . Buccal capsule depth 59 , width 50 . Deirids setate 59.5, long, 603 , nerve ring 630 , excretory pore 770 from anterior end; oesophagus length 2650 long. Bursal lobes not separate, dorsal lobe longest, ventral lobes shortest. Ventro-ventral and ventro-lateral rays apposed reaching margin of bursa; externo lateral ray divergent, reaching margin of bursa; medio-lateral and postero-lateral rays apposed, reaching margin of bursa; externo- dorsal ray arising close to dorsal trunk, not reaching margin of bursa (
Fig 17
); dorsal trunk stout, giving off pair of short lateral branches before bifurcating at about 4 / 5 its length, close to distal end (
Fig. 18
). Spicule 1080 long, about 1 / 10 body length, proximal ends irregularly knobbed, distal tips slightly curved, blunt, striated alae extend to spicule tips (
Figs 19, 20
). Gubernalculum trapezoidal (
Fig. 21
). Genital cone not prominent, anterior lip conical, posterior lip with, 1 pair simple appendages between 2 pairs bifid appendages (
Fig. 22
).

Female (n= 3 ): Body length 19.8 (15.7–27.8) mm, width 1120 ( 1050–1200 ), buccal capsule depth 108 , width 90 . Deirids 589 , nerve ring 601 , excretory pore 680 , from anterior end, oesophagus length 3713 ( 3410–3980 ). Vulva anterior to anus, 1697 ( 1400–1920 ) from the tip of tail. Ovejector with infundibulum 200 , sphincter 200 and vestibule 268 about same length; vagina vera length 200 (
Fig. 23
). Tail tapering, conical tip (
Figs 24, 25
), length 1267 ( 990–1490 ). Eggs ellipsoidal, immature (
Fig. 26
)

